      <text id="62" justification="0" size="4" underlined="false">
        <text>Scenario:
* Elevator arrives on a floor and notifies the 
   schedular through the elevator subsystem
* The scheduler receives the notification, checks if 
  the elevator is in it&apos;s list of elevators and updates
   its position
* The schedular then checks that this elevator is best suited to handle a 
  given floor request and sends the floor request to the elevator through 
  the elevator subsystem
* The elevator subsystem receives this request and instructs the elevator
to move accordingly
</text>
